      <div className="card-body">
      <div className="activity-wrap">
      <div className="activity">
      {today}<br></br>
      Today
      </div>
      <div className="activity">
      {completed}<br></br>
      Complete
      </div>

      </div>
      </div>

      </div>
  );
}
